import React, { useState, useEffect } from 'react';
import { CartContext } from './context/CartContext.js'; // Import CartContext from its dedicated file

// Import components from their respective files
import Header from './components/Header.jsx';
import HomePage from './pages/HomePage.jsx';
import ProductsPage from './pages/ProductsPage.jsx';
import ProductDetailPage from './pages/ProductDetailPage.jsx';
import CartPage from './pages/CartPage.jsx';
import CheckoutPage from './pages/CheckoutPage.jsx';
import SimulatedSearchEnginePage from './pages/SimulatedSearchEnginePage.jsx';


// --- Main App Component ---
const App = () => {
  const [currentPage, setCurrentPage] = useState('home');
  const [selectedProductId, setSelectedProductId] = useState(null);
  const [cart, setCart] = useState([]);

  // Effect to listen for hash changes and update routing state
  useEffect(() => {
    const handleHashChange = () => {
      const hash = window.location.hash;
      let pageName = '';
      let pageCategory = '';

      if (hash.startsWith('#/product/')) {
        const productIdFromHash = hash.split('?')[0].replace('#/product/', '');
        setCurrentPage('productDetail');
        setSelectedProductId(productIdFromHash);
        pageName = 'Product Detail Page';
        pageCategory = 'E-commerce';
      } else if (hash === '#/products') {
        setCurrentPage('products');
        setSelectedProductId(null);
        pageName = 'All Products Page';
        pageCategory = 'E-commerce';
      } else if (hash === '#/simulatedSearch') {
        setCurrentPage('simulatedSearch');
        setSelectedProductId(null);
        pageName = 'Simulated Search Engine Page';
        pageCategory = 'Marketing';
      } else if (hash === '#/cart') {
        setCurrentPage('cart');
        setSelectedProductId(null);
        pageName = 'Cart Page';
        pageCategory = 'E-commerce';
      } else if (hash === '#/checkout') {
        setCurrentPage('checkout');
        setSelectedProductId(null);
        pageName = 'Checkout Page';
        pageCategory = 'E-commerce';
      }
      else {
        setCurrentPage('home');
        setSelectedProductId(null);
        pageName = 'Home Page';
        pageCategory = 'E-commerce';
      }

      // Segment Page call for every route change
      if (window.analytics) {
        window.analytics.page(pageCategory, pageName, {
          path: window.location.pathname + window.location.hash,
          url: window.location.href
        });
      }

    };

    handleHashChange();
    window.addEventListener('hashchange', handleHashChange);
    return () => {
      window.removeEventListener('hashchange', handleHashChange);
    };
  }, []);

  // Placeholder for initial user identification (e.g., on first load or after login)
  useEffect(() => {
    const anonymousId = localStorage.getItem('anonymousId');
    if (!anonymousId) {
      const newAnonymousId = `anon-${Date.now()}-${Math.floor(Math.random() * 100000)}`;
      localStorage.setItem('anonymousId', newAnonymousId);
      if (window.analytics) {
        window.analytics.identify(newAnonymousId);
      }
    } else {
      if (window.analytics) {
        window.analytics.identify(anonymousId);
      }
    }

    if (window.analytics) {
      window.analytics.track('Application Loaded');
    }

  }, []);


  const navigate = (page, productId = null) => {
    let newHash = '';
    switch (page) {
      case 'home':
        newHash = '';
        break;
      case 'products':
        newHash = '#/products';
        break;
      case 'simulatedSearch':
        newHash = '#/simulatedSearch';
        break;
      case 'productDetail':
        newHash = `#/product/${productId}`;
        break;
      case 'cart':
        newHash = '#/cart';
        break;
      case 'checkout':
        newHash = '#/checkout';
        break;
      default:
        newHash = '';
    }
    window.location.hash = newHash;
  };

  const cartItemCount = cart.reduce((count, item) => count + item.quantity, 0);

  return (
    // Provide the cart context to all child components
    <CartContext.Provider value={{ cart, setCart }}>
      <div className="min-h-screen bg-gray-100 font-inter antialiased">
        <style>
          {`
            @import url('https://fonts.googleapis.com/css2?family=Inter:wght@300;400;500;600;700;800;900&display=swap');
            body {
              font-family: 'Inter', sans-serif;
            }
          `}
        </style>
        <Header navigate={navigate} cartItemCount={cartItemCount} />
        <main className="py-8">
          {(() => {
            switch (currentPage) {
              case 'home':
                return <HomePage navigate={navigate} />;
              case 'products':
                return <ProductsPage navigate={navigate} />;
              case 'simulatedSearch':
                return <SimulatedSearchEnginePage />;
              case 'productDetail':
                return <ProductDetailPage productId={selectedProductId} navigate={navigate} />;
              case 'cart':
                return <CartPage navigate={navigate} />;
              case 'checkout':
                return <CheckoutPage navigate={navigate} />;
              default:
                return <HomePage navigate={navigate} />;
            }
          })()}
        </main>
      </div>
    </CartContext.Provider>
  );
};

export default App;
